import React from 'react'
import MenuCard from './MenuCard'

const menuItems = [
  {
    id: 1,
    name: 'Espresso',
    price: '$3.50',
    category: 'Hot',
    img: 'https://ibb.co.com/Pv5cPsDF',
  },
  {
    id: 2,
    name: 'Cappuccino',
    price: '$4.50',
    category: 'Hot',
    img: 'https://ibb.co.com/SDBym4dy',
  },
  {
    id: 3,
    name: 'Latte',
    price: '$4.75',
    category: 'Hot',
    img: 'https://ibb.co.com/Y7X0Yj4t',
  },
  {
    id: 4,
    name: 'Iced Coffee',
    price: '$3.75',
    category: 'Cold',
    img: 'https://ibb.co.com/tMtfb9Sm',
  },
  {
    id: 5,
    name: 'Mocha',
    price: '$5.00',
    category: 'Hot',
    img: 'https://ibb.co.com/B2pHkwp2',
  },
  {
    id: 6,
    name: 'Americano',
    price: '$3.25',
    category: 'Hot',
    img: 'https://source.unsplash.com/400x300/?americano,coffee',
  },
  {
    id: 7,
    name: 'Cold Brew',
    price: '$4.25',
    category: 'Cold',
    img: 'https://source.unsplash.com/400x300/?coldbrew,coffee',
  },
  {
    id: 8,
    name: 'Frappuccino',
    price: '$5.50',
    category: 'Cold',
    img: 'https://source.unsplash.com/400x300/?frappuccino,coffee',
  },
]

export default function MenuSection() {
  return (
    <section id="menu">
      <h2 className="text-3xl font-extrabold mb-6">Our Menu</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
        {menuItems.map((item) => (
          <MenuCard key={item.id} item={item} />
        ))}
      </div>
    </section>
  )
}
